            backgroundColor: '#fff',
            borderRadius: '18px',
            cursor: 'pointer',
            fontSize: '24px', 
            padding: '10px 18px', 
            display: 'inline-flex', 
            alignItems: 'center',
            justifyContent: 'center',
            color: 'inherit',
